import { IonList, IonItem } from "@ionic/react";
import "./AcademicYearSemesterCoursesList.css";
import Course from "../models/Course";

interface CoursesTaughtListProps {
  courses: Course[];
}

const CoursesTaughtList: React.FC<CoursesTaughtListProps> = ({ courses }) => {
  return (
    <IonList>
      {courses.map((courseTaught, index) => {
        return (
          <IonItem button detail routerLink={`/course/${courseTaught.Id}`} key={index}>
            {`${courseTaught.CourseCode} - ${courseTaught.Title}`}
          </IonItem>
        );
      })}
    </IonList>
  );
};

export default CoursesTaughtList;
